import './App.css';
import NaviBar from './components/NaviBar';
import SideBar from './components/SideBar';
import MainContent from './components/MainContent';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <NaviBar />
      <div className="FlexBox">
        <SideBar />
        <MainContent/>
      </div>
      <Footer />
    </div>
  );
}



export default App;
